import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
      <Router>
        <Navbar/>
        <Routes>
          <Route exact path="/" element ={<Home/>}/>
          <Route path="/Dashboard" element ={<Dashboard/>}/>
          <Route path="/Orders" element ={<Orders/>}/>
          <Route path="/Products" element ={<Products/>}/>
          <Route path="/Customers" element ={<Customers/>}/>
        </Routes>
      </Router>
    </>
  );
}

export default App;
